import { HomePage, PostForm, NotFounfPage } from './pages'
import { Routes, Route } from 'react-router-dom'


function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<HomePage />} />
        <Route path='/new' element={<PostForm />} />
        <Route path='*' element={<NotFounfPage />} />
      </Routes>
    </div>
  );
}

export default App;
